import React from 'react';
import LoginPage from './LoginPage';
import { BrowserRouter as Router, Routes, Route, Navigate } from "react-router-dom";
import './App.css';

function App() {
  return (
      <Router>
        <div className="App">
          <Routes>
            <Route path="/" element={<LoginPage />} />
          </Routes>
        </div>
      </Router>
  );
}

export default App;
